import React, { useEffect, useState } from 'react';
import api from '../services/api';

type Player = {
  id: number;
  name: string;
  age: number;
  email?: string;
  phone?: string;
  country?: string;
  ranking: number;
  category: string;
  category_display: string;
  total_matches: number;
  wins: number;
  losses: number;
  win_rate: string;
  win_percentage: string;
  tournaments_played: number;
  best_finish?: string;
};

const PlayersList: React.FC = () => {
  const [players, setPlayers] = useState<Player[]>([]);
  const [loading, setLoading] = useState(true);
  const [searchTerm, setSearchTerm] = useState('');
  const [categoryFilter, setCategoryFilter] = useState('');
  const [sortBy, setSortBy] = useState('ranking');

  useEffect(() => {
    fetchPlayers();
  }, [searchTerm, categoryFilter, sortBy]);

  const fetchPlayers = async () => {
    try {
      setLoading(true);
      const params = new URLSearchParams();
      if (searchTerm) params.append('search', searchTerm);
      if (categoryFilter) params.append('category', categoryFilter);

      const res = await api.get(`/players/?${params.toString()}`);
      let sortedPlayers = res.data;

      // Sort players
      sortedPlayers.sort((a: Player, b: Player) => {
        if (sortBy === 'ranking') return b.ranking - a.ranking;
        if (sortBy === 'name') return a.name.localeCompare(b.name);
        if (sortBy === 'win_rate') return parseFloat(b.win_rate) - parseFloat(a.win_rate);
        return 0;
      });

      setPlayers(sortedPlayers);
    } catch (err) {
      console.error('Error fetching players:', err);
    } finally {
      setLoading(false);
    }
  };

  const getCategoryEmoji = (category: string) => {
    const emojis: { [key: string]: string } = {
      'MS': 'üë®',
      'WS': 'üë©',
      'MD': 'üë®‚Äçüë®',
      'WD': 'üë©‚Äçüë©',
      'XD': 'üë´'
    };
    return emojis[category] || 'üèì';
  };

  const getRankingBadge = (ranking: number) => {
    if (ranking >= 1000) return { color: '#FFD700', text: 'ü•á Elite' };
    if (ranking >= 500) return { color: '#C0C0C0', text: 'ü•à Advanced' };
    if (ranking >= 100) return { color: '#CD7F32', text: 'ü•â Intermediate' };
    return { color: '#87CEEB', text: 'üå± Beginner' };
  };

  return (
    <div style={{
      padding: '30px',
      maxWidth: '1400px',
      margin: '0 auto',
      fontFamily: 'Arial, sans-serif',
      background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
      minHeight: '100vh',
      color: 'white'
    }}>
      <div style={{
        background: 'rgba(255,255,255,0.1)',
        borderRadius: '20px',
        padding: '30px',
        backdropFilter: 'blur(10px)',
        border: '1px solid rgba(255,255,255,0.2)',
        boxShadow: '0 8px 32px rgba(0,0,0,0.3)'
      }}>
        <h2 style={{
          textAlign: 'center',
          marginBottom: '30px',
          fontSize: '2.5em',
          textShadow: '2px 2px 4px rgba(0,0,0,0.3)',
          color: '#ffd700'
        }}>
          üèÜ Player Rankings & Stats
        </h2>

        {/* Filters */}
        <div style={{
          display: 'grid',
          gridTemplateColumns: 'repeat(auto-fit, minmax(200px, 1fr))',
          gap: '20px',
          marginBottom: '30px',
          padding: '20px',
          background: 'rgba(255,255,255,0.1)',
          borderRadius: '15px'
        }}>
          <div>
            <label style={{ display: 'block', marginBottom: '8px', fontWeight: 'bold', color: '#ffd700' }}>
              üîç Search Players
            </label>
            <input
              type="text"
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
              placeholder="Search by name, email, or country..."
              style={{
                width: '100%',
                padding: '12px',
                borderRadius: '10px',
                border: 'none',
                background: 'rgba(255,255,255,0.9)',
                color: '#333',
                fontSize: '16px'
              }}
            />
          </div>

          <div>
            <label style={{ display: 'block', marginBottom: '8px', fontWeight: 'bold', color: '#ffd700' }}>
              üèì Filter by Category
            </label>
            <select
              value={categoryFilter}
              onChange={(e) => setCategoryFilter(e.target.value)}
              style={{
                width: '100%',
                padding: '12px',
                borderRadius: '10px',
                border: 'none',
                background: 'rgba(255,255,255,0.9)',
                color: '#333',
                fontSize: '16px',
                cursor: 'pointer'
              }}
            >
              <option value="">All Categories</option>
              <option value="MS">Men Singles</option>
              <option value="WS">Women Singles</option>
              <option value="MD">Men Doubles</option>
              <option value="WD">Women Doubles</option>
              <option value="XD">Mixed Doubles</option>
            </select>
          </div>

          <div>
            <label style={{ display: 'block', marginBottom: '8px', fontWeight: 'bold', color: '#ffd700' }}>
              üìä Sort By
            </label>
            <select
              value={sortBy}
              onChange={(e) => setSortBy(e.target.value)}
              style={{
                width: '100%',
                padding: '12px',
                borderRadius: '10px',
                border: 'none',
                background: 'rgba(255,255,255,0.9)',
                color: '#333',
                fontSize: '16px',
                cursor: 'pointer'
              }}
            >
              <option value="ranking">Ranking Points</option>
              <option value="name">Name</option>
              <option value="win_rate">Win Rate</option>
            </select>
          </div>
        </div>

        {loading ? (
          <div style={{ textAlign: 'center', padding: '50px' }}>
            <div style={{ fontSize: '2em', marginBottom: '20px' }}>üèì</div>
            <div style={{ fontSize: '1.2em', color: '#ffd700' }}>Loading players...</div>
          </div>
        ) : (
          <div style={{
            display: 'grid',
            gridTemplateColumns: 'repeat(auto-fill, minmax(350px, 1fr))',
            gap: '20px'
          }}>
            {players.map(player => {
              const badge = getRankingBadge(player.ranking);
              return (
                <div key={player.id} style={{
                  background: 'rgba(255,255,255,0.1)',
                  borderRadius: '15px',
                  padding: '20px',
                  border: '1px solid rgba(255,255,255,0.2)',
                  transition: 'transform 0.3s, box-shadow 0.3s',
                  cursor: 'pointer'
                }}
                onMouseEnter={(e) => {
                  e.currentTarget.style.transform = 'translateY(-5px)';
                  e.currentTarget.style.boxShadow = '0 10px 30px rgba(0,0,0,0.3)';
                }}
                onMouseLeave={(e) => {
                  e.currentTarget.style.transform = 'translateY(0)';
                  e.currentTarget.style.boxShadow = 'none';
                }}
                >
                  <div style={{ display: 'flex', alignItems: 'center', marginBottom: '15px' }}>
                    <div style={{
                      fontSize: '2em',
                      marginRight: '15px',
                      background: badge.color,
                      borderRadius: '50%',
                      width: '60px',
                      height: '60px',
                      display: 'flex',
                      alignItems: 'center',
                      justifyContent: 'center',
                      boxShadow: '0 4px 8px rgba(0,0,0,0.2)'
                    }}>
                      {getCategoryEmoji(player.category)}
                    </div>
                    <div>
                      <h3 style={{
                        margin: '0 0 5px 0',
                        color: '#ffd700',
                        fontSize: '1.2em',
                        textShadow: '1px 1px 2px rgba(0,0,0,0.3)'
                      }}>
                        {player.name}
                      </h3>
                      <div style={{
                        background: badge.color,
                        color: '#333',
                        padding: '4px 8px',
                        borderRadius: '10px',
                        fontSize: '0.8em',
                        fontWeight: 'bold',
                        display: 'inline-block'
                      }}>
                        {badge.text}
                      </div>
                    </div>
                  </div>

                  <div style={{ marginBottom: '15px' }}>
                    <div style={{ display: 'flex', justifyContent: 'space-between', marginBottom: '8px' }}>
                      <span style={{ color: '#ffd700' }}>üèÜ Ranking:</span>
                      <span style={{ fontWeight: 'bold', color: '#fff' }}>{player.ranking} pts</span>
                    </div>
                    <div style={{ display: 'flex', justifyContent: 'space-between', marginBottom: '8px' }}>
                      <span style={{ color: '#ffd700' }}>üéØ Win Rate:</span>
                      <span style={{ fontWeight: 'bold', color: '#fff' }}>{player.win_percentage}</span>
                    </div>
                    <div style={{ display: 'flex', justifyContent: 'space-between', marginBottom: '8px' }}>
                      <span style={{ color: '#ffd700' }}>üìä Record:</span>
                      <span style={{ fontWeight: 'bold', color: '#fff' }}>{player.wins}W - {player.losses}L</span>
                    </div>
                    <div style={{ display: 'flex', justifyContent: 'space-between', marginBottom: '8px' }}>
                      <span style={{ color: '#ffd700' }}>üèì Category:</span>
                      <span style={{ fontWeight: 'bold', color: '#fff' }}>{player.category_display}</span>
                    </div>
                    {player.country && (
                      <div style={{ display: 'flex', justifyContent: 'space-between', marginBottom: '8px' }}>
                        <span style={{ color: '#ffd700' }}>üåç Country:</span>
                        <span style={{ fontWeight: 'bold', color: '#fff' }}>{player.country}</span>
                      </div>
                    )}
                    {player.best_finish && (
                      <div style={{ display: 'flex', justifyContent: 'space-between' }}>
                        <span style={{ color: '#ffd700' }}>üèÖ Best Finish:</span>
                        <span style={{ fontWeight: 'bold', color: '#fff' }}>{player.best_finish}</span>
                      </div>
                    )}
                  </div>

                  <div style={{
                    background: 'rgba(255,255,255,0.1)',
                    padding: '10px',
                    borderRadius: '8px',
                    textAlign: 'center',
                    fontSize: '0.9em',
                    color: '#ddd'
                  }}>
                    Age: {player.age} ‚Ä¢ Tournaments: {player.tournaments_played}
                  </div>
                </div>
              );
            })}
          </div>
        )}

        {!loading && players.length === 0 && (
          <div style={{ textAlign: 'center', padding: '50px', color: '#ffd700' }}>
            <div style={{ fontSize: '3em', marginBottom: '20px' }}>üèì</div>
            <div style={{ fontSize: '1.2em' }}>No players found matching your criteria.</div>
          </div>
        )}
      </div>
    </div>
  );
};

export default PlayersList;
